import IRenderItem from "../Interfaces/irender_item";
import { Color } from "../../color";
import { IComponentData } from "../../../assetloader/json/interfaces/icomponent_data";
import { IComponentSerialize } from "../../../assetloader/json/interfaces/icomponent_serialize";
import { IComponentDeserialize } from "../../../assetloader/json/interfaces/icomponent_deserialize";
import { Vector2 } from "../../../../../utility/math_extended/vector2";

export class SpriteItem implements IRenderItem, IComponentData, IComponentSerialize, IComponentDeserialize{
    public name: string;
    public zIndex: number;
    public static: boolean = false;
    public width!: number;
    public height!: number;
    public pivot: Vector2;
    public alpha: number = 1;
    public texture: string;
    public imageSize: number;
    public tint: Color = new Color(255, 255, 255);
    
    constructor(name: string, texture: string, imageSize?: number, pivot?: Vector2, zIndex?: number) {
        this.name = name;
        this.texture = texture;
        this.imageSize = imageSize != null ? imageSize : 1;
        this.pivot = pivot != null ? pivot : new Vector2();
        this.zIndex = zIndex != null ? zIndex : 0;
    }

    Serialize(): Map<string, string> {
        let data: Map<string, string> = new Map();
        data.set("zIndex", this.zIndex.toString());
        data.set("width", this.width.toString());
        data.set("height", this.height.toString());
        data.set("pivot", this.pivot.toString());
        data.set("alpha", this.alpha.toString());
        data.set("texture", this.texture);
        data.set("imageSize", this.imageSize.toString());
        data.set("tint", this.tint.toString());
        return data;
    }

    Deserialize(data: Map<string, string>): void {
        this.zIndex = parseFloat(data.get("zIndex")!);
        this.width = parseFloat(data.get("width")!);
        this.height = parseFloat(data.get("height")!);
        this.pivot.fromString(data.get("pivot")!);
        this.alpha = parseFloat(data.get("alpha")!);
        this.texture = data.get("texture")!;
        this.imageSize = parseFloat(data.get("imageSize")!);
        this.tint.FromString(data.get("tint")!);
    }

    GetCopy(): SpriteItem {
        let dataCopy: SpriteItem = new SpriteItem(this.name, this.texture);
        dataCopy.zIndex = this.zIndex;
        dataCopy.width = this.width;
        dataCopy.height = this.height;
        dataCopy.pivot = this.pivot;
        dataCopy.alpha = this.alpha;
        return dataCopy;
    }
}
